mat4 axisRotationMatrix(vec3 axis, float angle) {
  axis = normalize(axis);

    0.0,                                0.0,                                0.0,                                1.0
  );

float hash13(vec3 p3)
{
	p3  = fract(p3 * .1031);
    p3 += dot(p3, p3.zyx + 31.32);
    return fract((p3.x + p3.y) * p3.z);
}


float grad3D(float hash, vec3 pos) 
{
    int h = int(1e4*hash) & 15;
	float u = h<8 ? pos.x : pos.y,
 		  v = h<4 ? pos.y : h==12||h==14 ? pos.x : pos.z;
    return ((h&1) == 0 ? u : -u) + ((h&2) == 0 ? v : -v);
}

float perlinNoise3D(vec3 pos)
{
	vec3 pi = floor(pos);

    float u = fade(pf.x);

float noise( in vec2 p )
{
    ivec2 i = ivec2(floor( p ));
     vec2 f =       fract( p );
	
	vec2 u = f*f*(3.0-2.0*f); // feel free to replace by a quintic smoothstep instead

                     dot( grad( i+ivec2(1,1) ), f-vec2(1.0,1.0) ), u.x), u.y);

float mn(in vec2 p, float tm) {

    vec2 aPos = vec2(tm);
    vec2 aScale = vec2(1.);
    float a = noise(p * aScale + aPos);

    vec2 bPos = vec2(-tm, 0.) * 1.;
    vec2 bScale = vec2(1.5);
    float b = noise((p + a) * bScale + bPos);

    vec2 cPos = vec2(0., -tm ) * 2.;
    vec2 cScale = vec2(1.);
    float c = noise((p + b) * cScale + cPos);

    return c;
}


float sdBox( vec3 p, vec3 b )
{
  vec3 q = abs(p) - b;
  return length(max(q,0.0)) + min(max(q.x,max(q.y,q.z)),0.0);
}    


float opLimitedRepetition( in vec3 p, in float s, in vec3 l )
{
    vec3 q = p - s*clamp(round(p/s),-l,l);
    return sdBox( p, q );
}

//------------------------------------------------------------------------
// SDF sculpting
//
// Thsi is the SDF function F that defines the shapes, in this case a sphere
// of radius 1. More info: https://iquilezles.org/articles/distfunctions/
//------------------------------------------------------------------------
float doModel( vec3 p, float tm )
{
    mat4 rm= identityMatrix();
    
    rm*= axisRotationMatrix( vec3(0.2,0.3,0.5), tm*0.5);
//    rm*= axisRotationMatrix( vec3(0.2,0.8,0.1), iTime*0.5);
    rm*=  translationMatrix( 0.,sin(tm)*10.0,0.  );
    
    p+= vec3(3.,0.,0.);

    vec4 pr= rm*vec4(p,1);
    
    // comment this line in order to try the fun SDF below
//    return length(p) - 1.0;
//    return min( min( length(p.xyz)-1.0, length(p.xy)-0.2 ),
//                min( length(p.yz )-0.2, length(p.zx)-0.2 ) );

    return sdBox( pr.xyz, vec3(1.,1.,1.));
}

vec3 doLighting( in vec3 pos, in vec3 nor, in vec3 rd, in float dis, in vec3 mal )
{
    vec3 lin = vec3(0.0);

    // key light
    //-----------------------------
    vec3  lig = normalize(vec3(1.0,0.7,0.2));
    float dif = max(dot(nor,lig),0.0);
    lin += dif*vec3(4.00,4.00,4.00);

    // ambient light
    //-----------------------------
    lin += vec3(0.7);

    
    // surface-light interacion
    //-----------------------------
    vec3 col = mal*lin;

    
    // fog    
    //-----------------------------
	col *= exp(-0.01*dis*dis);

    return col;
}

//------------------------------------------------------------------------

void doCamera( out vec3 camPos, out vec3 camTar, in float time )

// more info: https://iquilezles.org/articles/normalsSDF/
vec3 compute_normal( in vec3 pos, float tm )
{
    const float eps = 0.002;             // precision of the normal computation
    const vec3 v1 = vec3( 1.0,-1.0,-1.0);
    const vec3 v2 = vec3(-1.0,-1.0, 1.0);
    const vec3 v3 = vec3(-1.0, 1.0,-1.0);
    const vec3 v4 = vec3( 1.0, 1.0, 1.0);
	return normalize( v1*doModel( pos + v1*eps, tm ) + 
					  v2*doModel( pos + v2*eps, tm ) + 
					  v3*doModel( pos + v3*eps, tm ) + 
					  v4*doModel( pos + v4*eps, tm ) );
}

float intersect( in vec3 ro, in vec3 rd, float tm )
{
	const float maxd = 20.0;           
    float t = 0.0;
    for( int i=0; i<128; i++ )          // max number of raymarching iterations is 90
    {
	    float d = doModel( ro+rd*t, tm );
        if( d<0.001 || t>maxd ) break;  // precision 0.001, maximum distance 20
        t += d;
    }
    return (t<maxd) ? t : -1.0;
}

vec4 cubeColor( in vec2 uv, float tm )
{
    // camera movement (ro is ray origin, ta is the target location we are looking at)
    vec3 ro, ta; 
    doCamera( ro, ta, iTime );

    // camera matrix
    vec3 ww = normalize( ta - ro );
    vec3 uu = normalize( cross(ww,vec3(0.0,1.0,0.0) ) );
    vec3 vv = normalize( cross(uu,ww));
    mat3 camMat = mat3( uu, vv, ww );
    
	// create ray
	vec3 rd = normalize( camMat * vec3(uv,2.0) ); // 2.0 is the lens length

    // compute background
	vec4 col = vec4(0);

	// project/intersect through raymarching of SDFs
    float t = intersect( ro, rd, tm );
    if( t>-0.5 )
    {
        // geometry
        vec3 pos = ro + t*rd;
        vec3 nor = compute_normal(pos, tm);

        // materials
        vec3 mal = doMaterial( pos, nor );

        // lighting
//        col = mal; 
        col = vec4( doLighting( pos, nor, rd, t, mal ), 1);
	}

    // monitor gamma adjustnment
//	col = pow( clamp(col,0.0,1.0), vec3(0.4545) );
	   
    return col;
}

vec4 cube2Color( in vec2 uv, float tm )
{
    float ul= length(uv);

    vec2 uuv= uv*(sin(ul*8. - (tm*2.))+1.);

    float alpha=  min(1.,1./(ul*8.+0.01));
    
    return vec4( cubeColor(uuv, tm).rgb,  alpha  );
}

vec4 cube3Color( in vec2 uv, float tm )
{
    return vec4( cubeColor(uv/4., tm).rgb,  0.33 );
}

vec4 cube4Color( in vec2 uv, float tm )
{
    vec4 col= vec4(0.);
    for( float i= 0.; i< 4.; i++ )
    {
        float sz= pow(2.,i+1.)/4.;

        vec4 nc= cubeColor(uv*sz, tm+i*0.4);

        if( nc.a > 0.)
            col= vec4(nc.rgb,sz*0.5  );
    }

    return col;
}

vec4 cube5Color( in vec2 uv, float tm )
{
    vec4 nc= cubeColor(uv, tm);

    float c= (nc.r + nc.g + nc.b)/3.;

    return vec4(c,c,c,nc.a);
}

vec4 cube6Color( in vec2 uv, float tm )
{
    return cubeColor(uv, tm - uv.y*4. );
}

vec4 cube7Color( in vec2 uv, float tm )
{
    float a=floor(uv.x*4.);


    return cubeColor(uv, tm+a );
}

vec4 getEffectColor(int effect, vec2 uv )
{
    switch( effect )
    {
        case 0: return vec4( 0,0,0,0 );
        case 1: return cubeColor(uv + vec2(1.3,0.), iTime );
        case 2: return cube2Color(uv + vec2(1.3,0.),  iTime );
        case 3: return cube3Color(uv + vec2(1.3,0.),  iTime );
        case 4: return cube4Color(uv + vec2(1.3,0.),  iTime );
        case 5: return cube5Color(uv + vec2(1.3,0.),  iTime );
        case 6: return cube6Color(uv + vec2(1.3,0.),  iTime );
        case 7: return cube7Color(uv + vec2(1.3,0.),  iTime );
    }
    return vec4(1,0,1,1);
}


bool wavyCircleFade(vec2 uv, vec2 centre, float f)
{
    vec2 del= uv-centre;
    float d= length(del);
    float a= atan( del.y, del.x );
    d= d*(1. + sin(a*8.)*0.3);
    
    return !(mod(d,0.25) > f*0.25);
}

bool squareFade( vec2 uv, float f )
{
    float w= 0.2;
    vec2 uuv= vec2( mod(uv.x,w)-w/2., mod(uv.y,w)-w/2. );
    
    return max(abs(uuv.x), abs(uuv.y)) < f*0.2;
}

bool horizontalFade( vec2 uv, float f )
{
    float w= 0.2;
    float uuv= mod(uv.y,w)-w/2.;
    
    return abs(uuv) < f*0.2;
}

bool verticalFade( vec2 uv, float f )
{
    float w= 0.2;
    float uuv= mod(uv.x,w)-w/2.;
    
    return abs(uuv) < f*0.2;
}

float rand(vec2 co){
    return fract(sin(dot(co, vec2(12.9898, 78.233))) * 43758.5453);
}

bool randomFade( vec2 uv, float f )
{
    
    return ( rand(uv) < f );
}

bool manyCircleFade(vec2 uv, float f)
{
    vec2 uuv= vec2( mod(uv.x,0.2), mod(uv.y,0.2) );
    
    return length( uuv-vec2(0.1,0.1) ) < f*0.1*sqrt(2.);
}

bool checkCircleFade(vec2 uv, vec2 centre, float f)
{
    float spikes= 16.;

    vec2 del= uv-centre;
    float d= log(length(del))*.1;
    float a= atan( del.y, del.x );
    
    return !((mod(d,0.05) > f*0.05) || (mod(a,2.*PI/spikes) > f*(2.*PI/spikes)));
}

bool rotateFade(vec2 uv, vec2 centre, float f)
{
    float spikes= 2.;
    
    vec2 d= uv-centre;
    float a= atan( d.y, d.x );
    
    return !(mod(a,2.*PI/spikes) > f*(2.*PI/spikes));
}

        for (var y = 0; y < glyphHeight; y++) {
            for (var x = 0; x < glyphWidth; x++)
            {
                var col= d.data[((x + xOff) + (y + yOff)*d.width)*4];
                setPixel( char, x, y, glyphWidth, col,col );

                if( col > 0 )
                    for( var y2= 0; y2 <= 3; y2++ )
                        for( var x2= 0; x2 <= 3; x2++ )
                            setPixel( shadowChar, x+x2, y+y2, glyphWidth+3, 0, col );
            }
        }

        createImageBitmap( new ImageData( char, glyphWidth, glyphHeight ) )
           .then( (v)=> charBitmaps.push( v ));
        createImageBitmap( new ImageData( shadowChar, glyphWidth+3, glyphHeight+3 ) )
           .then( (v)=> charShadowBitmaps.push( v ) );
    }
}


function RemapChar( ch )
{
    return ch-32;
}

function RenderString(ctx, str, x, y) {
    for (var i = 0; i < str.length; i++)
        RenderShadowChar(ctx, RemapChar( str.charCodeAt(i)), x + i * (glyphWidth+1) - 1, y-1 );

    for (var i = 0; i < str.length; i++)
        RenderChar(ctx, RemapChar( str.charCodeAt(i)), x + i * (glyphWidth+1), y);
}


function RenderShadowChar(ctx, char, x, y) {
    if( charShadowBitmaps[char] == null )
        return;

    ctx.drawImage( charShadowBitmaps[char], x,y );
}

function RenderChar(ctx, char, x, y)
{
    if( charBitmaps[char] == null )
        return;

    ctx.drawImage( charBitmaps[char], x,y );
}

class ShaderScreen
{
    Init( fragmentShaderText  )
    {
        this.fragmentShaderText= fragmentShaderText;
        this.canvas = document.createElement("canvas");
        this.shaderCanvas = document.createElement("canvas");

        if (!this.canvas)
            console.log("no canvas?");

        this.setupCanvas( this.canvas, 2 );
        this.setupCanvas( this.shaderCanvas, 1 );

        {
            var bd = document.querySelector("body");
            bd.style.margin= 0;
            bd.style.padding= 0;
            bd.style.backgroundColor= 'black';
        }

        this.offscreenCanvas= new OffscreenCanvas(this.canvas.width, this.canvas.height);
        this.windowWidth= 0;
        this.windowHeight= 0;
        this.width= 0;
        this.height= 0;
        this.scale= 1;

       document.body.appendChild(this.canvas);
       document.body.appendChild(this.shaderCanvas);

       this.gl = this.shaderCanvas.getContext("webgl2", { preserveDrawingBuffer: true });
       this.shaderProgram = new GLProgram(this.gl, vertexShaderText, this.fragmentShaderText);
       this.billboard = new GLRect(this.gl);

    }

    setupCanvas( canv, zIndex )
    {
        canv.style.top = '50%';
        canv.style.left = '50%';
        canv.style.width = "100%";
        canv.style.height = "100%";
        canv.style.transform = 'translate(-50%, -50%)';
        canv.style.display= 'block';
        canv.style.position = 'absolute';
        canv.style.zIndex = zIndex;
    }

    updateCanvasSizes( canv )
    {
        canv.style.width = `${this.width}px`;
        canv.style.height = `${this.height}px`;
        canv.width= this.width;
        canv.height= this.height;
    }

    Update()
    {
        var w = window.innerWidth;
        var h = window.innerHeight;

        if (w != this.windowWidth || h != this.windowHeight)
        {
            this.windowWidth = w;
            this.windowHeight = h;

            if ((w / h) > screenRatio)
            {
                this.width= h*screenRatio;
                this.height= h;
            }
            else
            {
                this.width= w;
                this.height= w/screenRatio;
            }


            console.log(`${this.width} ${this.height}`);

            this.updateCanvasSizes( this.canvas );
            this.updateCanvasSizes( this.shaderCanvas );

            this.offscreenCanvas.width= this.width;
            this.offscreenCanvas.height= this.height;

            this.scale= this.width/2000;


            let positionLocation = this.gl.getAttribLocation(this.shaderProgram.prg, "a_position");
            this.gl.enableVertexAttribArray(positionLocation);
            this.gl.vertexAttribPointer(positionLocation, 2, this.gl.FLOAT, false, 0, 0);

            console.log('resize');
        }
    }

    setBrown()
    {

    }

    GetContext()
    {
        return this.offscreenCanvas.getContext("2d");
    }

    Present( currentTime )
    {
        this.gl.viewport(0, 0, this.width, this.height);

        this.gl.enable(this.gl.BLEND);
        this.gl.blendFunc(this.gl.ONE, this.gl.ZERO);

        this.shaderProgram.updateRes(this.width, this.height);
        this.shaderProgram.use();
        this.shaderProgram.uTime.set(currentTime/1000.0);


        this.billboard.render();

        const bitmapOne = this.offscreenCanvas.transferToImageBitmap();
        var cctx= this.canvas.getContext("bitmaprenderer");
        cctx.transferFromImageBitmap(bitmapOne);
    }

    Clear(color)
    {
        var ctx= this.GetContext();
        ctx.resetTransform();

        ctx.fillStyle= color;
        ctx.fillRect( 0,0, this.width, this.height );
    }
}

class GLUniform {

    constructor(gl, prg, name, suffix) {
        this.gl = gl;
        this.name = name;
        this.suffix = suffix;
        this.location = this.gl.getUniformLocation(prg, name);
    }

    set(...values) {
        let method = "uniform" + this.suffix;
        let args = [this.location].concat(values);
        this.gl[method].apply(this.gl, args);
    }
}

class GLProgram {
    constructor( gl, vertexShaderText,fragmentShaderText) {
        this.gl = gl;
        this.prg = this.gl.createProgram();
        this.addShader(vertexShaderText, this.gl.VERTEX_SHADER);
        this.addShader(fragmentShaderText, this.gl.FRAGMENT_SHADER);

        this.gl.linkProgram(this.prg);

        if (!this.gl.getProgramParameter(this.prg, this.gl.LINK_STATUS)) {
            const info = this.gl.getProgramInfoLog(this.prg);
            throw `Could not compile WebGL program. \n\n${info}`;
        }



        this.gl.useProgram(this.prg);

        this.gl.uniform1i(this.gl.getUniformLocation(this.prg, "u_texture"), 0);

        this.preDemo = new GLUniform(this.gl,this.prg, "preDemo", "1i");
        this.pulse = new GLUniform(this.gl,this.prg, "pulse", "1f");
        this.uTime = new GLUniform(this.gl,this.prg, "iTime", "1f");
        this.uResolution = new GLUniform(this.gl,this.prg, "iResolution", "2f");
        this.brown = new GLUniform(this.gl,this.prg, "brown", "1f");
        this.effect1 = new GLUniform(this.gl,this.prg, "effect1", "1i");
        this.effect2 = new GLUniform(this.gl,this.prg, "effect2", "1i");
        this.effectCrossfade = new GLUniform(this.gl,this.prg, "effectCrossfade", "1f");
        this.effectCrossfadeType = new GLUniform(this.gl,this.prg, "effectCrossfadeType", "1i");
    }

    updateRes( width, height )
    {
        this.uResolution.set(width, height);
    }

    addShader(source, type) {
        let shader = this.gl.createShader(type);
        this.gl.shaderSource(shader, source);
        this.gl.compileShader(shader);
        let isCompiled = this.gl.getShaderParameter(shader, this.gl.COMPILE_STATUS);
        if (!isCompiled) {
            throw new Error("Shader compile error: " + this.gl.getShaderInfoLog(shader));
        }
        this.gl.attachShader(this.prg, shader);
    }


    addTexture(width, height, pixels) {
        var texture = this.gl.createTexture();
        this.gl.activeTexture(this.gl.TEXTURE0);
        this.gl.bindTexture(this.gl.TEXTURE_2D, texture);
        this.gl.texParameteri(this.gl.TEXTURE_2D, this.gl.TEXTURE_MAG_FILTER, this.gl.NEAREST);
        this.gl.texParameteri(this.gl.TEXTURE_2D, this.gl.TEXTURE_MIN_FILTER, this.gl.NEAREST);

        this.gl.texImage2D(
            this.gl.TEXTURE_2D,
            0,
            this.gl.RGBA,
            width, height,
            0,
            this.gl.RGBA, this.gl.UNSIGNED_BYTE,
            new Uint8Array(pixels)
        );

    }

    use() {
        this.gl.useProgram(this.prg);
    }
}

class GLRect {
    constructor( gl ) {
        this.gl= gl;
        this.verts = new Float32Array([-1, -1, 1, -1, -1, 1, 1, 1]);

        let buffer = this.gl.createBuffer();
        this.gl.bindBuffer(this.gl.ARRAY_BUFFER, buffer);
        this.gl.bufferData(this.gl.ARRAY_BUFFER, this.verts, this.gl.STATIC_DRAW);
    }

    render() {
        this.gl.drawArrays(this.gl.TRIANGLE_STRIP, 0, 4);
    }
}

function isBuiltIn(info) {
    const name = info.name;
    return name.startsWith("gl_") || name.startsWith("webgl_");
}


function glEnumToString(gl, value) {
    const keys = [];
    for (const key in gl) {
        if (gl[key] === value) {
            keys.push(key);
        }
    }
    return keys.length ? keys.join(' | ') : `0x${value.toString(16)}`;
}

function dumpGLProgram(prg) {
    var output = '';
    var shaders = gl.getAttachedShaders(prg);

    output += `program
  #shaders: ${shaders.length}
`;

    {
        output += 'Uniforms:'
        const numUniforms = gl.getProgramParameter(prg, gl.ACTIVE_UNIFORMS);
        const indices = [...Array(numUniforms).keys()];
        const blockIndices = gl.getActiveUniforms(prg, indices, gl.UNIFORM_BLOCK_INDEX);
        const offsets = gl.getActiveUniforms(prg, indices, gl.UNIFORM_OFFSET);

        for (let ii = 0; ii < numUniforms; ++ii) {
            const uniformInfo = gl.getActiveUniform(prg, ii);
            if (isBuiltIn(uniformInfo)) {
                continue;
            }
            const { name, type, size } = uniformInfo;
            const blockIndex = blockIndices[ii];
            const offset = offsets[ii];

            output += `${name} ${glEnumToString(gl, type)}\n`;
        }

    }

    return output;
}


function dumpGL() {
    var output = 'dumping OpenGL\n';
    var prg = gl.getParameter(gl.CURRENT_PROGRAM);


    if (prg == null)
        output += 'No active program\n';
    else
        output += dumpGLProgram(prg);

    console.log(output);
}

class RunningState extends State 
{
    constructor()
    {
        super();
        this.sp= 0;
        this.cl= 0;
        this.md= false;
        this.backgroundOffset= 0;
        this.effectTime= 0;

        this.curEffect= 0;
        this.oldEffect= 0;
        this.crossfade= 0;
        this.reverseCrossfade= false;
        this.crossfadeType= 0;
    }


    render(ctx) 
    {
        screen.shaderProgram.brown.set(0);
        var ft= this.md ? this.lastFrameTime*6 : this.lastFrameTime;


        this.effectTime+= this.lastFrameTime;
        if( this.effectTime > 30 )
        {
            this.oldEffect= this.curEffect;
            this.curEffect= Math.floor(Math.random() * 7); 
            //this.reverse= Math.random() > 0.5;
            this.reverse= false;
            this.crossfadeType= Math.floor(Math.random() * 7); 
            this.effectTime= 0;
        }


        if( this.effectTime < 10 )
            this.crossfade= (this.effectTime/10);
        else
            this.crossfade= 1;


        if( this.reverseCrossfade )
        {
            screen.shaderProgram.effect1.set( this.oldEffect+1 );
            screen.shaderProgram.effect2.set( this.curEffect+1 );
            screen.shaderProgram.effectCrossfade.set( 1-this.crossfade );
        }
        else
        {
            screen.shaderProgram.effect1.set( this.curEffect+1 );
            screen.shaderProgram.effect2.set( this.oldEffect+1 );
            screen.shaderProgram.effectCrossfade.set( this.crossfade );
        }

        screen.shaderProgram.effectCrossfadeType.set( this.crossfadeType+1 );

        this.backgroundOffset+= ft;



        var lineHeight= glyphHeight + 5;



        let cenX= 5000;

        let lineAng= 0.01;

        for( var i= 0; i< 20; i++ )
            {
                let st= scrollText[(this.cl+i)%scrollText.length];
    
                ctx.resetTransform();
                ctx.scale(screen.scale,screen.scale);

                    if( st.length > 0 && st[0]=='*' )
                    {
                        ctx.translate(-cenX,500);
                        ctx.rotate((lineAng*i)+this.sp  - Math.PI*0.03);
                        ctx.translate(cenX+ 40,0);
                        RenderString(ctx, st.substring(1), 200, 0 );
                    }
                    else
                    {
                        ctx.translate(-cenX,500);
                        ctx.rotate((lineAng*i)+this.sp  - Math.PI*0.03);
                        ctx.translate(cenX+ 40,0);
                        RenderString(ctx, st,  (50-(st.length/2))*(glyphWidth+1) - 50, 0 );
                    }
            }


        this.sp-= ft*0.002;

        if( this.sp < 0 )
        {
            this.sp+= lineAng;
            this.cl++;

            if( this.cl == scrollText.length )
            {
                this.cl= 0;
            }
        }

//        RenderString( ctx, this.effectTime.toString(), 60,60  );
    }

}


function RenderCircleString( ctx, curTime, rotationSpeed, radius, txtSize, txt )
{
    for( var i= txt.length-1; i>= 0; i-- )
        {
            var oo= (i/txt.length);
            var step= oo*2.0*Math.PI;
    
            ctx.resetTransform();
    
            ctx.scale(screen.scale, screen.scale);
    
            let ang= curTime*rotationSpeed+ step;
    
            ctx.translate(
                1000+  Math.cos(ang)*radius,
                500+ Math.sin(ang)*radius );
    
                ctx.rotate( ang + Math.PI/2 );
    
    //            ctx.scale( 1+Math.sin(oo-this.curTime*0.001)*0.4, 1+Math.sin(oo-this.curTime*0.001)*0.4  );
    
            ctx.scale(txtSize,txtSize);
    //        ctx.scale( iii,iii );
    
            RenderString(ctx, txt.substring(i,i+1),  0, 0 );
        }
    
}

    ctx.resetTransform();

}


class StartState extends State {
    render(ctx) {
        screen.shaderProgram.brown.set(1);
        screen.shaderProgram.effect1.set(0);
        screen.shaderProgram.effect2.set(0);
        RenderClickToStart(ctx, this.curTime/1000.0, 200);
    }

    OnClick() {
        this.nextState= new FadingInState();
    }
}

class FadingInState extends State {
    render(ctx) 
    {
        if (this.TotalStateTime() < 1000) 
        {
            screen.shaderProgram.brown.set(1-(this.TotalStateTime()/1000.0));
            RenderClickToStart(ctx, this.curTime/1000.0, 200 + this.TotalStateTime() );
        }
        else
        {
            startMusic();

            this.nextState= new RunningState();
        }
    }
}

function animate() {
    let ts = performance.now();

    const ct = performance.now() - runTimeStart;

    screen.Update();


    var ctx = screen.GetContext();

    curState.curTime = ts;
    curState.render(ctx);

    if( curState.nextState!= null )
        curState= curState.nextState;

    var ft = performance.now() - ts;

    lastFrameTime = ft.toString();



    if( showFps )
    {
        ctx.resetTransform();
        ctx.scale( screen.scale, screen.scale );

        RenderString( ctx,lastFrameTime, 1, 1 );
    }

    screen.Present(ts);

    frame++;
    requestAnimationFrame(animate);
}

function BuildBitmap( b64data, width, height, func )
{
    var ca= Uint8ClampedArray.from(window.atob( b64data ), c => c.charCodeAt(0));
    var id= new ImageData( ca, width, height );
    createImageBitmap( id ).then( func );
}
function BuildImageData( b64data, width, height )
{
    var ca= Uint8ClampedArray.from(window.atob( b64data ), c => c.charCodeAt(0));
    return new ImageData( ca, width, height );
}
